import React, { useState } from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);

  return (
    <header className="bg-blue-600 text-white p-4">
      <div className="container mx-auto flex justify-between items-center">
        <h1 className="text-2xl font-bold">Insurance Baazaar : make your choice</h1>
        <button
          className="md:hidden focus:outline-none"
          onClick={() => setIsMenuOpen(!isMenuOpen)}
        >
          <svg
            xmlns="http://www.w3.org/2000/svg"
            className="h-6 w-6"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M4 6h16M4 12h16m-7 6h7"
            />
          </svg>
        </button>
        <nav className={`md:flex space-x-4 ${isMenuOpen ? 'block' : 'hidden'} mt-4 md:mt-0`}>
          <Link to="/Home" className="block md:inline hover:text-blue-200">Home</Link>
          <Link to="/health-insurance" className="block md:inline hover:text-blue-200">Health Insurance</Link>
          <Link to="/contact-us" className="block md:inline hover:text-blue-200">Contact Us</Link>
          <Link to="/about-us" className="block md:inline hover:text-blue-200">About Us</Link>
        </nav>
      </div>
    </header>
  );
};

export default Header;
